QF7RDSjQYQ?version=3\\u0026autohide=1\"},\"title\":{\"simpleText\":\"The secret world of Sugar Babies and Sugar Daddies | 60 Minutes Australia\"},\"description\":{\"simpleText\":\"Incredibly, right now in Australia there are more than 200,000 young women who have either become, or are trying to be, “sugar babies”. Their ambition is for a sweet life of pampered luxury, paid for by older, sometimes much older, men. For the so-called “sugar daddies”, the equation is simple: the wealthier they are, the more attractive they are. But as Sarah Abo finds out, it’s not hard to read between the lines here. The term sugar baby is often code for sex worker, and the male moneybags are often crinkled-up creeps. And that leads to a very important question: is this sugar baby phenomenon about empowering women or exploiting them?\\n\\nWATCH more of 60 Minutes Australia: https:\/\/www.60minutes.com.au \\nLIKE 60 Minutes Australia on Facebook: https:\/\/www.facebook.com\/60Minutes9 \\nFOLLOW 60 Minutes Australia on Twitter: https:\/\/twitter.com\/60Mins \\nFOLLOW 60 Minutes Australia on Instagram: https:\/\/www.instagram.com\/60minutes9\\n\\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\\n\\n#60MinutesAustralia\"},\"lengthSeconds\":\"1504\",\"ownerProfileUrl\":\"http:\/\/www.youtube.com\/user\/60Minutes9\",\"externalChannelId\":\"UC0L1suV8pVgO4pCAIBNGx5w\",\"isFamilySafe\":true,\"availableCountries\":[\"AD\",\"AE\",\"AF\",\"AG\",\"AI\",\"AL\",\"AM\",\"AO\",\"AQ\",\"AR\",\"AS\",\"AT\",\"AU\",\"AW\",\"AX\",\"AZ\",\"BA\",\"BB\",\"BD\",\"BE\",\"BF\",\"BG\",\"BH\",\"BI\",\"BJ\",\"BL\",\"BM\",\"BN\",\"BO\",\"BQ\",\"BR\",\"BS\",\"BT\",\"BV\",\"BW\",\"BY\",\"BZ\",\"CA\",\"CC\",\"CD\",\"CF\",\"CG\",\"CH\",\"CI\",\" ddies”, the equation is simple: the wealthier they are, the more attractive they are. But as Sarah Abo finds out, it’s not hard to read between the lines here. The term sugar baby is often code for sex worker, and the male moneybags are often crinkled-up creeps. And that leads to a very important question: is this sugar baby phenomenon about empowering women or exploiting them?\n\nWATCH more of 60 Minutes Australia: https://www.60minutes.com.au \nLIKE 60 Minutes Australia on Facebook: https://www.facebook.com/60Minutes9 \nFOLLOW 60 Minutes Australia on Twitter: https://twitter.com/60Mins \nFOLLOW 60 Minutes Australia on Instagram: https://www.instagram.com/60minutes9\n\nFor forty years, 60 Minutes have been telling Australians the world’s greatest stories. Tales that changed history, our nation and our lives. Reporters Liz Hayes, Allison Langdon, Tara Brown, Charles Wooley, Liam Bartlett and Sarah Abo look past the headlines because there is always a bigger picture. Sundays are for 60 Minutes.\n\n#60MinutesAustralia","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/xQF7RDSjQYQ/hqdefault.jpg?sqp=-oaymwEiCKgBEF5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLBhxOchHjQe33NCXagHTBCAuANZrw","width":168,"height":94},{"url":"https://i.ytimg.com/vi/xQF7RDSjQYQ/hqdefault.jpg?sqp=-oaymwEiCMQBEG5IWvKriqkDFQgBFQAAAAAYASUAAMhCPQCAokN4AQ==\u0026rs=AOn4CLAvywvUXcQ4IWoXxuSBHAigQmev0A","width":196,"height":110},{"url":"https://i.ytimg.com/vi/xQF7RDSjQYQ/hqdefault.jpg?sqp=-oaymwEjCPYBEIoBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLBCbsK_XpeNnzH5fif6e-Hlenyxrg","width":246,"height":138},{"url":"https://i.ytimg.com/vi/xQF7RDSjQYQ/hqdefault.jpg?sqp=-oaymwEjCNACELwBSFryq4qpAxUIARUAAAAAGAElAADIQj0AgKJDeAE=\u0026rs=AOn4CLAg4FzUFK63lzArIf8gr6-ar08vGQ","width":336,"height":188}]},"useCipher":true,"averageRating":4.2905817,"allowRatings":true,"viewCount":"2849826","author":"60 Minutes Australia","isPrivate":false,"isUnpluggedCorpus":false,"isLive
